import callApi from "../callApi/callApi";
import types from "./../ty"
class Orders {
  getAllOrders = () => {
    return async (dispatch) => {
      let result = await callApi(`http://localhost:9000/orders`);
      console.log(result);
    };
  };
}
export default new Orders();
